  state = {
    broodsoort: [
      "Witte Bol",
      "Bruine Bol",
      "Witte Boterham",
      "Bruine Boterham",
      "Krentenbol",
      "Zuurdesem",
      "Geen"
    ],
    boter: ["Ja", "Nee"],
    beleg: ["Kaas", "Gebraden gehakt", "Ham", "Jam", "Chocopasta", "Niets"]
  };
  render() {
    return (
      <section>
        <Broodje />
        <Broodje />
        <Broodje />
      </section>
    );
  }
}

export default BroodjesList;
